<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Funnel SVG</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 0;
        display: grid;
        place-items: center;
      }

      /* Black Animation Code */

      @keyframes blackLeftToRight {
        0% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0 100%);
        }

        100% {
          clip-path: polygon(100% 0, 100% 0, 100% 100%, 100% 100%);
        }
      }

      @keyframes blackRightToLeft {
        0% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0 100%);
        }

        100% {
          clip-path: polygon(0 0, 0% 0, 0% 100%, 0 100%);
        }
      }

      @keyframes blackTopToBottom {
        0% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0% 100%);
        }
        100% {
          clip-path: polygon(0 100%, 100% 100%, 100% 100%, 0% 100%);
        }
      }

      /* Black Phases */

      #b-start,
      #b-phase-one,
      #b-phase-two,
      #b-phase-five,
      #b-phase-six,
      #b-the-end {
        transform-box: fill-box;
        animation-name: blackLeftToRight;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      #b-phase-three,
      #b-phase-four {
        animation-name: blackRightToLeft;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      /* Black Dots */

      #b-one,
      #b-two,
      #b-eight,
      #b-nine {
        animation-name: blackLeftToRight;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      #b-three,
      #b-seven {
        animation-name: blackTopToBottom;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      #b-four,
      #b-five,
      #b-six {
        animation-name: blackRightToLeft;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      /* Black Animation Delay */

      #b-phase-one {
        animation-delay: 2s;
      }

      #b-phase-two {
        animation-delay: 4s;
      }

      #b-phase-three {
        animation-delay: 7s;
      }

      #b-phase-four {
        animation-delay: 9s;
      }

      #b-phase-five {
        animation-delay: 12s;
      }

      #b-phase-six {
        animation-delay: 14s;
      }

      #b-the-end {
        animation-delay: 16s;
      }

      /* Black Dots Delay */

      #b-one {
        animation-delay: 1s;
      }

      #b-two {
        animation-delay: 3s;
      }

      #b-three {
        animation-delay: 5s;
      }

      #b-four {
        animation-delay: 6s;
      }

      #b-five {
        animation-delay: 8s;
      }

      #b-six {
        animation-delay: 10s;
      }

      #b-seven {
        animation-delay: 11s;
      }

      #b-eight {
        animation-delay: 13s;
      }

      #b-nine {
        animation-delay: 15s;
      }

      /* Cyan Animation Code */

      @keyframes clipInLeft {
        0% {
          clip-path: polygon(0 0, 0% 0, 0% 100%, 0% 100%);
        }

        100% {
          opacity: 1;
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0% 100%);
        }
      }

      @keyframes clipInDown {
        0% {
          clip-path: polygon(0 0, 100% 0, 100% 0%, 0 0%);
        }

        100% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0 100%);
        }
      }

      @keyframes clipInRight {
        0% {
          clip-path: polygon(100% 0, 100% 0, 100% 100%, 100% 100%);
        }

        100% {
          clip-path: polygon(0% 0, 100% 0, 100% 100%, 0% 100%);
        }
      }

      /* Cyan Phases */

      #start,
      #phase-one,
      #phase-two,
      #phase-five,
      #phase-six,
      #the-end {
        transform-box: fill-box;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      #phase-three,
      #phase-four {
        clip-path: polygon(100% 0, 100% 0, 100% 100%, 100% 100%);
        animation-name: clipInRight;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      /* Cyan Dots */

      #one,
      #two,
      #eight,
      #nine {
        clip-path: polygon(0 0, 0% 0, 0% 100%, 0% 100%);
        animation-name: clipInLeft;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      #three,
      #seven {
        animation-name: clipInDown;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
        clip-path: polygon(0 0, 100% 0, 100% 0%, 0 0%);
      }

      #four,
      #five,
      #six {
        clip-path: polygon(100% 0, 100% 0, 100% 100%, 100% 100%);
        animation-name: clipInRight;
        animation-duration: 1s;
        animation-timing-function: ease-in-out;
        animation-iteration-count: 1;
        animation-direction: normal;
        animation-fill-mode: forwards;
      }

      /* Cyan Animation Delay */

      #phase-one {
        animation-delay: 2s;
      }

      #phase-two {
        animation-delay: 4s;
      }

      #phase-three {
        animation-delay: 7s;
      }

      #phase-four {
        animation-delay: 9s;
      }

      #phase-five {
        animation-delay: 12s;
      }

      #phase-six {
        animation-delay: 14s;
      }

      #the-end {
        animation-delay: 16s;
      }

      /* Cyan Dots Delay */

      #one {
        animation-delay: 1s;
      }

      #two {
        animation-delay: 3s;
      }

      #three {
        animation-delay: 5s;
      }

      #four {
        animation-delay: 6s;
      }

      #five {
        animation-delay: 8s;
      }

      #six {
        animation-delay: 10s;
      }

      #seven {
        animation-delay: 11s;
      }

      #eight {
        animation-delay: 13s;
      }

      #nine {
        animation-delay: 15s;
      }
    </style>
  </head>
